pragma solidity ^0.5.0;

//Data segregation for company and regulator profiles 
contract UserDataStorage {
    address owner;

    struct RegulatorInformation {
        string name;
        bool authorised;
    }

    struct CompanyInformation {
        string name;
        bool authorised;
    }

    constructor(string memory _ownerName) public {
        owner = msg.sender;
        approvedRegulators[msg.sender] = RegulatorInformation({name: _ownerName, authorised: true});
    }

    mapping(address => RegulatorInformation) approvedRegulators;
    mapping(address => CompanyInformation) approvedCompanies;

    function addRegulator(string memory name, address _address, bool authorized) public {
        approvedRegulators[_address] = RegulatorInformation({name: name, authorised: authorized});
    }

    function updateRegulatorAuthorisation(address _address, bool newAuthorisationStatus) public {
        approvedRegulators[_address].authorised = newAuthorisationStatus;
    }

    function removeRegulator(address _address) public {
        delete approvedRegulators[_address];
    }

    function getRegulatorAuthorisation(address _address) public view returns(bool) {
        return approvedRegulators[_address].authorised;
    }

}
